//Returns after one sec
void delay(int wait_time){
    //0b011 starts the timer at addr 0xFFFEC600
    volatile int *timer_addr = 0xFFFEC600;
    int start_timer = 3;

    //Saves the delay value to the timer addr load 
    *timer_addr = wait_time;
    *(timer_addr + 0x8) = start_timer;
    int check_stop =  *(timer_addr + 0xC);

    //Wait for the timer to return 1
    while(check_stop != 1){
        check_stop =  *(timer_addr + 0xC);
    }
    
    //Stop and reset the timer
    int stop_timer = 0;
    *(timer_addr + 0x8) = stop_timer;
    int reset  = 1;
    *(timer_addr + 0xC) = reset;

    return;
}

void start_screen_animation(volatile int * pixel_ctrl_ptr){
    int W = 125, H = 14;
    int i = 115, j = 56;

    //Wait 0.5 seconds before erasing
    delay(0x05F5E100);

    for(int k = 0; k < W*H*2 - 1; k++){
        int red = ((blank_pk[k + 1] & 0xF8) >> 3) << 11;
        int green  = (((blank_pk[k] & 0xE0) >> 5)) | ((blank_pk[k+1] & 0x7) << 3) ;		
        int blue = (blank_pk[k] & 0x1f);			
            
        short int p = red | ( (green << 5) | blue);
            
        plot_pixel( 0 + i, j, p);
            
        i += 1;

        if (i == W) {
            i = 0;
            j += 1;
        }		
    }

    wait_for_vsync(); // swap front and back buffers on VGA vertical sync
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer

    //Wait 0.5 seconds then re-draw
    delay(0x05F5E100);

    for(int k = 0; k < W*H*2 - 1; k++){
        int red = ((press_key[k + 1] & 0xF8) >> 3) << 11;
        int green  = (((press_key[k] & 0xE0) >> 5)) | ((press_key[k+1] & 0x7) << 3) ;		
        int blue = (press_key[k] & 0x1f);			
            
        short int p = red | ( (green << 5) | blue);
            
        plot_pixel( 0 + i, j, p);
            
        i += 1;

        if (i == W) {
            i = 0;
            j += 1;
        }		
    }

    wait_for_vsync(); // swap front and back buffers on VGA vertical sync
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
}